import { Link } from "react-router-dom";

function Header(props) {
  const { currentUser } = props;
  return (
    <header>
      <h1>FitHub</h1>
      <nav>
        <Link to="/studios">Studios</Link>
        {currentUser ? <>(button)</> : <Link to="/signin">Sign In</Link>}
      </nav>
      <hr />
    </header>
  );
}

export default Header;
